import React from 'react';
import { Link } from 'react-router-dom';

export default function Cars({Data}){
    return(
        <div className='cars'>
            {Data.map((e,i)=>
                <div key={i} className="car">
                    <div style={{backgroundImage:`url('img/cars/car${e.ref}.jpg')`}} className="img"></div>
                    <table>
                        <tr>
                            <td>name</td>
                            <td></td>
                        </tr>
                    </table>
                    <p>Name : {e.name}</p>
                    <p>Company : {e.company}</p>
                    <p>class : {e.class}</p>
                    <p>description : {e.desc.slice(0,200)}...</p>
                    <Link to={`Car/${e.ref}`}>Details</Link>
                </div>
            )}
        </div>
    )
}
